BEGIN
  FOR cur_rec IN (SELECT table_name FROM user_tables) LOOP
    EXECUTE IMMEDIATE 'DROP TABLE ' || cur_rec.table_name || ' CASCADE CONSTRAINTS';
  END LOOP;
END;
/


CREATE TABLE STORE (
    S_NO NUMBER(6,0) PRIMARY KEY,
    S_ID VARCHAR2(20 BYTE),
    S_PW VARCHAR2(20 BYTE),
    S_NAME VARCHAR2(25 BYTE),
    S_SN VARCHAR2(25 BYTE),
    S_POSTCODE VARCHAR2(50 BYTE),
    S_ADDRESS VARCHAR2(250 BYTE),
    S_PHONE VARCHAR2(12 BYTE),
    S_CONT VARCHAR2(150 BYTE),
    S_DETAILADDRESS VARCHAR2(50 BYTE),
    S_EXTRAADDRESS VARCHAR2(50 BYTE),
    S_IMGNAME VARCHAR2(100 BYTE),
    S_IMGEXT VARCHAR2(100 BYTE),
    S_SIMGNAME VARCHAR2(100 BYTE)
);

CREATE TABLE TUSER (
    U_NO NUMBER(6,0) PRIMARY KEY,
    U_ID VARCHAR2(20 BYTE),
    U_PW VARCHAR2(20 BYTE),
    U_NAME VARCHAR2(20 BYTE),
    U_BIRTH NUMBER(4,0),
    U_POSTCODE VARCHAR2(10 BYTE),
    U_ADDRESS VARCHAR2(250 BYTE),
    U_PHONE VARCHAR2(12 BYTE),
    U_POINT NUMBER(10,0) DEFAULT 5000,
    U_DETAILADDRESS VARCHAR2(250 BYTE),
    U_EXTRAADDRESS VARCHAR2(40 BYTE)
);
CREATE TABLE WINE (
    W_NO NUMBER(6,0) PRIMARY KEY,
    W_WINEERY VARCHAR2(100 BYTE),
    W_NAME VARCHAR2(130 BYTE),
    W_VINTAGE VARCHAR2(20 BYTE) DEFAULT 'N/V',
    W_AVG NUMBER(4,2),
    W_REVIEWS VARCHAR2(30 BYTE),
    W_LOCATION VARCHAR2(100 BYTE) DEFAULT '정보없음',
    W_IMAGE VARCHAR2(200 BYTE),
    W_KIND VARCHAR2(15 BYTE) DEFAULT NULL
);

CREATE TABLE WINELIST (
    W_NO NUMBER(6,0),
    W_AMOUNT NUMBER(6,0) DEFAULT 0,
    W_PRICE NUMBER(10,0) DEFAULT 0,
    S_NO NUMBER(6,0),
    WL_IDX NUMBER(6,0) PRIMARY KEY,
    FOREIGN KEY (W_NO) REFERENCES WINE(W_NO),
    FOREIGN KEY (S_NO) REFERENCES STORE(S_NO)
);

CREATE TABLE BOARD (
    B_IDX NUMBER(6,0) PRIMARY KEY,
    S_NO NUMBER(6,0),
    B_TITLE VARCHAR2(50 BYTE) DEFAULT '제목없음',
    B_CONT VARCHAR2(250 BYTE) DEFAULT '내용없음',
    FOREIGN KEY (S_NO) REFERENCES STORE(S_NO)
);

CREATE TABLE CART (
    C_IDX NUMBER(6,0) PRIMARY KEY,
    W_NO NUMBER(6,0),
    S_NO NUMBER(6,0),
    C_COUNT NUMBER,
    U_NO NUMBER(6,0),
    WL_IDX NUMBER(6,0),
    FOREIGN KEY (W_NO) REFERENCES WINE(W_NO),
    FOREIGN KEY (S_NO) REFERENCES STORE(S_NO),
    FOREIGN KEY (U_NO) REFERENCES TUSER(U_NO),
    FOREIGN KEY (WL_IDX) REFERENCES WINELIST(WL_IDX)
);

CREATE TABLE EVENT (
    E_IDX NUMBER(6,0) PRIMARY KEY,
    S_NO NUMBER(6,0),
    E_TITLE VARCHAR2(50 BYTE),
    E_FIMG VARCHAR2(100 BYTE),
    E_BIMG VARCHAR2(100 BYTE),
    E_SDATE DATE,
    E_EDATE DATE,
    FOREIGN KEY (S_NO) REFERENCES STORE(S_NO)
);

CREATE TABLE FAVORITESTORE (
    S_NO NUMBER(6,0),
    U_NO NUMBER(6,0),
    PRIMARY KEY (S_NO, U_NO),
    FOREIGN KEY (S_NO) REFERENCES STORE(S_NO),
    FOREIGN KEY (U_NO) REFERENCES TUSER(U_NO)
);

CREATE TABLE SALESHISTORY (
    SH_DATE DATE,
    PAYNUM VARCHAR2(100 BYTE),
    U_NO NUMBER(6,0),
    S_NO NUMBER(6,0),
    P_ALLPRICE NUMBER(15,0),
    W_NO NUMBER(6,0),
    P_STATE VARCHAR2(30 BYTE) DEFAULT '결제완료',
    WL_IDX NUMBER(6,0),
    S_AMOUNT NUMBER(10,0),
    PRIMARY KEY (SH_DATE, PAYNUM),
    FOREIGN KEY (U_NO) REFERENCES TUSER(U_NO),
    FOREIGN KEY (S_NO) REFERENCES STORE(S_NO),
    FOREIGN KEY (W_NO) REFERENCES WINE(W_NO),
    FOREIGN KEY (WL_IDX) REFERENCES WINELIST(WL_IDX)
);
CREATE TABLE STORECS (
    SCS_IDX NUMBER(6,0) PRIMARY KEY,
    S_NO NUMBER(6,0),
    SCS_TITLE VARCHAR2(100 BYTE),
    SCS_CONT VARCHAR2(250 BYTE),
    SW_DATE DATE,
    SCS_IMG VARCHAR2(150 BYTE),
    RES_DATE DATE,
    RESPONSE VARCHAR2(250 BYTE),
    SCS_CATEGORY VARCHAR2(30 BYTE),
    FOREIGN KEY (S_NO) REFERENCES STORE(S_NO)
);
CREATE TABLE TESTING (
    T_IDX NUMBER(6,0) PRIMARY KEY,
    T_TITLE VARCHAR2(150 BYTE),
    T_CONT VARCHAR2(250 BYTE) DEFAULT '내용없음',
    W_NO NUMBER(6,0),
    T_DATE DATE DEFAULT NULL,
    T_COST NUMBER(10,0) DEFAULT 0,
    S_NO NUMBER(6,0),
    FOREIGN KEY (W_NO) REFERENCES WINE(W_NO),
    FOREIGN KEY (S_NO) REFERENCES STORE(S_NO)
);

CREATE TABLE TESTINGJOIN (
    T_IDX NUMBER(6,0),
    U_NO NUMBER(6,0),
    PRIMARY KEY (T_IDX, U_NO),
    FOREIGN KEY (T_IDX) REFERENCES TESTING(T_IDX),
    FOREIGN KEY (U_NO) REFERENCES TUSER(U_NO)
);
CREATE TABLE USERCS (
    UCS_IDX NUMBER(6,0) PRIMARY KEY,
    U_NO NUMBER(6,0),
    UCS_TITLE VARCHAR2(100 BYTE),
    UCS_CONT VARCHAR2(250 BYTE),
    UW_DATE DATE,
    UCS_IMG VARCHAR2(150 BYTE),
    RES_DATE DATE,
    RESPONSE VARCHAR2(250 BYTE),
    UCS_CATEGORY VARCHAR2(30 BYTE),
    FOREIGN KEY (U_NO) REFERENCES TUSER(U_NO)
);
CREATE TABLE WINELIST (
    W_NO NUMBER(6,0),
    W_AMOUNT NUMBER(6,0) DEFAULT 0,
    W_PRICE NUMBER(10,0) DEFAULT 0,
    S_NO NUMBER(6,0),
    WL_IDX NUMBER(6,0) PRIMARY KEY,
    FOREIGN KEY (W_NO) REFERENCES WINE(W_NO),
    FOREIGN KEY (S_NO) REFERENCES STORE(S_NO)
);


---------------------- 와인 데이터------------------

COMMIT;












